essentials/history-mode.html.body:
Modo historia HTML5El modo por defecto para vue-router es hash mode - el cual utiliza una almohadilla para simular la URL completa para que la p√°gina no sea recargada cuando la URL cambia.Para eliminar la almohadilla, podemos seleccionar el modo historia del router, el cual utiliza el m√©todo history.pushState de la API para conseguir una navegaci√≥n sin recarga de p√°gina:const router = new VueRouter({
  mode: 'history',
  routes: [...]
})
Cuando utilices el modo historial, la URL lucir√° "normal", por ejemplo: http://oursite.com/user/id. ¬°Hermoso!Sin embargo, hay un problema: dado que nuestra aplicaci√≥n es de una sola p√°gina del lado cliente, sin una configuraci√≥n apropiada del lado servidor los usuarios van a obtener errores 404 si intentan acceder directamente a http://oursite.com/user/id en sus navegadores. Eso es horrible.No hay problema: para solucionar el error, todo lo que debes hacer es agregar un redireccionamiento en tu servidor. Si la URL no coincide con ning√∫n recurso est√°tico, debes apuntar a la misma p√°gina index.html donde se encuentra tu aplicaci√≥n. De nuevo, ¬°Hermoso!Ejemplos de configuraciones de servidoresApache
  RewriteEngine On
  RewriteBase /
  RewriteRule ^index\.html$ - [L]
  RewriteCond %{REQUEST_FILENAME} !-f
  RewriteCond %{REQUEST_FILENAME} !-d
  RewriteRule . /index.html [L]

nginxlocation / {
  try_files $uri $uri/ /index.html;
}
Node.js (Express)Para Node.js/Express, considera utilizar el middleware connect-history-api-fallback.DeventajasHay una deventaja para esto: tu servidor ya no reportar√° errores 404 dado que todas las rutas no encontradas ser√°n redireccionadas al archivo index.html. Para solucionar este problema debes implementar dentro de la aplicaci√≥n Vue una ruta por defecto para mostrar una p√°gina de error 404:const router = new VueRouter({
  mode: 'history',
  routes: [
    { path: '*', component: NotFoundComponent }
  ]
})
Otra soluci√≥n, si utilizas un servidor Node.js, es utilizar el router del lado del servidor para analizar las URL ingresadas y responder con un error 404 si ninguna ruta coincide.

advanced/navigation-guards.html.body:
Guardias de navegaci√≥nComo el nombre sugiere, las guardias de navegaci√≥n provistas por vue-router son b√°sicamente utilizadas para proteger rutas de navegaci√≥n ya sea redireccionando o cancel√°ndolas. Hay varias maneras de engancharse en el proceso de navegaci√≥n de rutas: globalmente, por ruta o dentro de los componentes.Recuerda: Los cambios en los par√°metros o las queries no har√°n que se ejecuten los guardias de navegaci√≥n. Simplemente observa el objeto $route para poder reaccionar frente a esos cambios o utiliza el guardia beforeRouteUpdate en el componente.Guardias globalesPuedes registrar guardias before globales utilizando router.beforeEach:const router = new VueRouter({ ... })

router.beforeEach((to, from, next) => {
  // ...
})
Las guardias before globales son llamadas por orden de creaci√≥n, cuando una navegaci√≥n comienza. Las guardias pueden ejecutarse asincr√≥nicamente, y la navegaci√≥n se considera pendiente hasta que todos los hooks sean resueltos.Cada funci√≥n guardia recibe tres argumentos:to: Route: el Objeto Route hacia donde se navega.
from: Route: la ruta actual desde la cual se navega.
next: Function: esta funci√≥n debe ser ejecutada para resolver el hook. La acci√≥n a realizar depende de los argumentos provistos a next:next(): moverse al siguiente hook en la cadena. Si no queda ninguno, la navegaci√≥n se confirma.
next(false): cancelar la navegaci√≥n actual. Si la URL en el navegador cambi√≥ (ya sea manualmente o a trav√©s del bot√≥n atr√°s), ser√° reseteada al valor de la ruta from.
next('/') o next({ path: '/' }): redirecciona a una ruta diferente. La navegaci√≥n actual ser√° abortada y una nueva ser√° iniciada.
next(error): (2.4.0+) si el argumento pasado a next es una instancia de Error, la navegaci√≥n se abortar√° y el error ser√° pasado a las funciones callback registradas a trav√©s de router.onError().

Aseg√∫rese de llamar siempre a la funci√≥n next, sino el hook nunca ser√° resuelto.Guardias de resoluci√≥n globalesNuevo en 2.5.0A partir de la versi√≥n 2.5.0 puedes registrar un guardia global con router.beforeResolve. Esto es similar a router.beforeEach, con la diferencia que los guardias de resoluci√≥n ser√°n llamados justo antes de que la navegaci√≥n sea confirmada, despu√©s que todos los guardias en el componente y los componentes de rutas as√≠ncronos sean resueltos.Post hooks globalesTambi√©n puedes registrar hooks globales que se ejecutar√°n despu√©s de que la navegaci√≥n sea confirmada. Sin embargo, a diferencia de los guardias, estos hooks no reciben una funci√≥n next y no pueden afectar la navegaci√≥n:router.afterEach((to, from) => {
  // ...
})
Guardias por rutaPuedes definir guardias beforeEnter directamente en el objeto de configuraci√≥n de una ruta:const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      beforeEnter: (to, from, next) => {
        // ...
      }
    }
  ]
})
Estos guardias tienen exactamente la misma firma que los guardias before globales.Guardias en componentesPor √∫ltimo, puedes directamente definir guardias de navegaci√≥n dentro de los componentes de ruta (los que son pasados a la configuraci√≥n del router) con las siguientes opciones:beforeRouteEnter

beforeRouteUpdate (agregado en la versi√≥n 2.2)

beforeRouteLeave

const Foo = {
  template: `...`,
  beforeRouteEnter (to, from, next) {
    // se llama antes que la ruta que renderiza este componente sea confirmada.
    // NO tiene acceso a la instancia del componente `this`,
    // ¬°porque no ha sido creada todav√≠a cuando este guardia es ejecutado!
  },
  beforeRouteUpdate (to, from, next) {
    // se llama cuando la ruta que renderiza este componente ha cambiado,
    // pero este componente es reusado en la nueva ruta.
    // Por ejemplo, para una ruta con par√°metros din√°micos /foo/:id, cuando
    // navegamos desde /foo/1 havia /foo/2, la misma instancia del componente Foo
    // ser√° reusada, y este _hook_ ser√° llamado cuando eso suceda.
    // Tiene acceso a la instancia del componente `this`
  },
  beforeRouteLeave (to, from, next) {
    // se llama cuando la ruta que renderiza el componente est√° por ser
    // abandonada.
    // Tiene acceso a la instancia del componente `this`
  }
}
La guardia beforeRouteEnter NO tiene acceso a this, porque es ejecutada antes que la navegaci√≥n sea confirmada, por lo tanto el componente destino todav√≠a no ha sido creado.Sin embargo, puedes acceder a la instancia pasando una funci√≥n callback a next. La funci√≥n callback se ejecutar√° cuando la navegaci√≥n sea confirmada, y la instancia del componente ser√° pasada como argumento:beforeRouteEnter (to, from, next) {
  next(vm => {
    // accede a la instancia del componente a trav√©s de `vm`
  })
}
Puedes acceder directamente a this dentro de beforeRouteLeave. La guardia leave se utiliza normalmente para prevenir al usuario cuando intenta abandonar la ruta accidentalmente sin guardar cambios. La navegaci√≥n puede ser cancelada ejecutando next(false).El flujo de resoluci√≥n de navegaci√≥n completoSe dispara la navegaci√≥n.

Se llaman a los guardias leave en los componentes desactivados.

Se llaman a los guardias beforeEach globales.

Se llaman a los guardias beforeRouteUpdate en los componentes reutilizados (2.2+).

Se llama a beforeEnter en las configuraciones de rutas.

Se resuelven componentes de rutas as√≠ncronos.

Se llama a beforeRouteEnter en los componentes activados.

Se llama a los guardias globales beforeResolve (2.5+).

Se confirma la navegaci√≥n.

Se llaman a los hook globalesafterEach.

Se disparan las actualizaciones del DOM.

Se llaman a las funciones callback pasadas a next en los guardias beforeRouteEnter con las instancias creadas.

advanced/meta.html.body:
Campos Meta en las rutasPuedes incluir un campo meta cuando definas una ruta:const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      children: [
        {
          path: 'bar',
          component: Bar,
