  ]
})
Entonces, ¬øcomo accedemos al campo meta?Primero, cada objeto route en la configuraci√≥n de routes se llama registro de ruta. Los registros de ruta pueden estar anidados. Por lo tanto, cuando una ruta coincida, existe la posibilidad que lo haga con m√°s de un registro de ruta.Por ejemplo, con la configuraci√≥n anterior, la URL /foo/bar coincidir√° tanto con el registro de ruta padre como con el hijo.Todos los registros de rutas que hayan coincidido son expuestos en el objeto $route (y tambi√©n a los objetos route en las guardias de navegaci√≥n) como el array $route.matched. Por ende, necesitaremos iterar sobre $route.matched para verificar campos meta en los registros de rutas.Un caso de uso de ejemplo es verificar la existencia de campos metas en los guardias de navegaci√≥n global:router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.requiresAuth)) {
    // esta ruta requiere autenticaci√≥n, verificamos que haya iniciado sesi√≥n
    // sino, redirigimos a la p√°gina de inicio de sesi√≥n.
    if (!auth.loggedIn()) {
      next({
        path: '/login',
        query: { redirect: to.fullPath }
      })
    } else {
      next()
    }
  } else {
    next() // ¬°Aseg√∫rate de ejecutar next siempre!
  }
})

