Obtener la informaci√≥n antes de la navegaci√≥nCon este enfoque, obtenemos la informaci√≥n antes de navegar a la nueva ruta. Podemos obtener los datos en el guardia beforeRouteEnter del componente entrante, y solo ejecutar next cuando se haya completado:export default {
