Lazy loadingCuando se construyen aplicaciones con un sistema de empaquetamiento de m√≥dulos, el archivo JavaScript resultante puede terminar siendo muy grande, afectando los tiempos de carga de la p√°gina. Ser√≠a m√°s eficiente si pudiesemos dividir los componentes de cada ruta en porciones separadas y cargarlas solo cuando esa ruta es visitada.Combinando las caracter√≠sticas as√≠ncronas de componentes de Vue y las caracter√≠sticas de divisi√≥n de c√≥digo de Webpack, es trivial el lazy loading de componentes de ruta.Todo lo que necesitamos es definir nuestros componentes de rutas como as√≠ncronos:const Foo = resolve => {
  // require.ensure es la sintaxis especial de Webpack para indicar un punto de divisi√≥n de c√≥digo.
  require.ensure(['./Foo.vue'], () => {
    resolve(require('./Foo.vue'))
  })
}
Hay una alternativa a la sintaxis de divisi√≥n de c√≥digo utilizando require como lo hace AMD, por lo que puede simplificarse como:const Foo = resolve => require(['./Foo.vue'], resolve)
Nada debe cambiarse en la configuraci√≥n del router, solo utiliza Foo como lo har√≠as normalmente:const router = new VueRouter({
  routes: [
    { path: '/foo', component: Foo }
  ]
